const { getCommandsConfig } = require("../utils/module.js");

let Threads = {};

async function checkRole(event, api) {
  if (!Threads[event.threadID]) {
    Threads[event.threadID] = await api.getThreadInfo(event.threadID);
    if (Threads[event.threadID])
      console.log("Create th√™m nh√≥m " + event.threadID);
    else console.error("Kh√¥ng th·ªÉ t·∫°o th√™m nh√≥m " + event.threadID);
  }

  const threadInfo = Threads[event.threadID];
  let groupRole = 0;
  let botRole = 0;
  if (threadInfo.isGroup) {
    threadInfo.adminIDs.forEach((item) => {
      if (item.id === event.senderID) groupRole = 1;
    });
  }
  global.client.config.PERMISSION.forEach((item) => {
    if (item.USERID == event.senderID) botRole = item.LEVEL;
  });
  return Math.max(botRole, groupRole);
}

function getCountMessageReply(event, count) {
  if (count === undefined) count = 0;
  if (typeof event.messageReply === "undefined") {
    event.count = count;
    // console.log(count,event)
    return event;
  }
  const reply = global.client.runHandleReply.get(event.messageReply.messageID);
  if (reply && !reply.isUnsend) {
    // Ki·ªÉm tra n·∫øu reply ch·ª©a file ·∫£nh ho·∫∑c media
    if (reply.attachments && reply.attachments.length > 0) {
      count++; // TƒÉng s·ªë l·∫ßn n·∫øu c√≥ reply ch·ª©a media
    } else {
      count++;
    }
    return getCountMessageReply(reply, count);
  }
  event.count = count;
  return event;
}

module.exports = async (api) => {
  global.botID = api.getCurrentUserID();
  global.client.onload.forEach((item) => item(api));
  api.setOptions({ selfListen: true, listenEvents: true });
  api.listenMqtt(async (err, event) => {
    // console.log(global.client.runHandleReply);
    if (err) return console.error(err);
    if (event.type !== "message" && event.type !== "message_reply") return;
    if (event.body === undefined || event.body === "") return;
    const commandsConfig = getCommandsConfig();
    const { PREFIX } = global.client.config;
    const args = event.body
      ? event.body
          .trim()
          .split(" ")
          .filter((item) => item !== "")
      : [];
    if (event.type === "message_reply") {
      if (event.senderID === global.botID)
        global.client.runHandleReply.set(event.messageID, event);
      if (event.messageReply.senderID === global.botID) {
        global.client.runHandleReply.set(event.messageID, event);
        let startMessage = getCountMessageReply(event);
        event.count = startMessage.count;
        event.startMessage = startMessage;
        let startCommander = startMessage.body
          .split(" ")
          .filter((item) => item !== "")[0]
          .replace(PREFIX, "");
        // console.log(`ƒê√£ l·∫•y ƒë∆∞·ª£c summon msg`);
        // console.log(event.startMessage);
        let isHadHandleReply = global.client.handleReply.find(
          (item) => item.name === startCommander && item.type === "command"
        );
        if (isHadHandleReply) {
          console.log(startCommander, isHadHandleReply);
          return isHadHandleReply.func(api, event, args);
        }
      }
    }
    if (args[0].charAt(0) === PREFIX) {
      const commander = args[0].replace(PREFIX, "");
      if (global.client.commands.get(commander)) {
        var commandConfig = commandsConfig.find(
          (item) => item.name === commander
        );
        const userRole = await checkRole(event, api);
        if (userRole < commandConfig.permission)
          return api.sendMessage(
            "L·ªói ‚ùó B·∫°n kh√¥ng ƒë·ªß quy·ªÅn ƒë·ªÉ d√πng l·ªánh",
            event.threadID,
            event.messageID
          );
        let isHadHandleReply = global.client.handleReply.find(
          (item) => item.name === commander && item.type === "command"
        );
        if (isHadHandleReply) {
          global.client.runHandleReply.set(event.messageID, event);
          // console.log(`ƒê√£ l·∫•y ƒë∆∞·ª£c handleReply cua command.js`);
        }
        global.client.commands.get(commander)(api, event, args);
      } else
        return api.sendMessage(
          `L·ªói ‚ùó Kh√¥ng t√¨m th·∫•y l·ªánh ${commander}`,
          event.threadID,
          event.messageID
        );
    }
  });
};

